import React from 'react';
import Grid from '@mui/material/Grid';
import MediaCard from "../MediaCard";
import transformerBar from "../../pictures/TransformerBar.jpeg";
import mg4 from "../../pictures/MG4.png";

function Rogue() {
    return (
        <Grid 
            container
            direction="column" 
            justifyContent="flex-start" 
            spacing={5}
        >
            <Grid 
                item                
                sx={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    width: 1
                }}
            >
                <MediaCard
                    title="Kabuki Transformer Bar"
                    img={transformerBar}
                    alt="Transformer Bar"
                    imgBorderRadius="10px"
                    infoList={[
                            ["Redesigned the original Transformer Bar by Kabuki. "],
                            ["Worked with various vendors to ensure quality product."],
                            ["Oversaw the manufacturing and assembly launch of the porduct."]
                    ]}
                    site="true"
                    hrefSite="https://www.roguefitness.com/rogue-kabuki-transformer-bar"
                />
            </Grid>
            <Grid 
                item                
                sx={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    width: 1
                }}
            >
                <MediaCard
                    title="Rogue MG-4CN Narrow Multi Grip Camber Bar"
                    img={mg4}
                    alt="Rogue MG-4"
                    imgBorderRadius="10px"
                    infoList={[
                            ["Redesigned the original Transformer Bar by Kabuki. "],
                            ["Worked with various vendors to ensure quality product."],
                            ["Oversaw the manufacturing and assembly launch of the porduct."]
                    ]}
                    site="true"
                    hrefSite="https://www.roguefitness.com/rogue-kabuki-transformer-bar"
                    patent="true"
                    hrefPatent="https://patentimages.storage.googleapis.com/f7/72/0e/f42361a699acf6/US20230241445A1.pdf"
                />
            </Grid>
        </Grid>
    );
}

export default Rogue;
